  `audit_opinion` varchar(255) DEFAULT NULL COMMENT '审核意见',
  `secretkey_id` varchar(64) DEFAULT NULL COMMENT '秘钥ID',
  `server_address` varchar(255) DEFAULT NULL COMMENT '中心节点地址',
  `is_del` tinyint(4) DEFAULT '0' COMMENT '是否删除',
